import React from "react";

const ProductsListasadmin = (props) => {
  return (
    <div class="card">
      {props.data &&
        props.data.map((e, i) => {
          return (
            <div class="card-border-top">
              <div class="img">
                <img></img>
              </div>
              <span> Person</span>
              <p class="job"> Job Title</p>
              <button
                onClick={() => {
                  props.switchView("updateproject");
                  props.setId(e.id);
                }}
              >
                update
              </button>
              <button
                onClick={() => {
                  props.deleteProduct(e, i);
                }}
              >
                delete
              </button>
            </div>
          );
        })}
      <button
        onClick={() => {
          props.switchView("addproduct");
        }}
      ></button>
    </div>
  );
};

export default ProductsListasadmin;
